import { Route, Routes } from "react-router-dom";
import Navbar from "./components/Navbar";
Cart


const App = () => {
  return (
    <div>
      <div>
        <Navbar />
      </div>
      <Routes>
        <Route path="" element={<Home/>}/>
        <Route path="" element={<Cart/>}/>
      </Routes>
    </div>
  );
};

export default App;
